import React from "react";
import { useNavigate } from "react-router-dom";

const Logout = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear the local storage token
    localStorage.removeItem("token");
    // Redirect to login page
    navigate("/login");
  };
};

export default Logout;
